import React from 'react';

const MainPage = () => {
  return (
    <header className="App-header">
      <h1>Counter</h1>
      <button to='/counter' onClick={(event) => {
        console.log('custom event here!', event)
      }}> Click me! </button>
    </header>
  );
};
export default MainPage;
